import {
  init_esm_shims
} from "./chunk-WWCIODDN.js";

// Modals/CustomEmbed/ce_title.ts
init_esm_shims();
var ce_title_default = {
  id: "ce_title",
  async execute(interaction) {
    const title = interaction.fields.getTextInputValue("title");
    const embed = interaction.message.embeds[0];
    embed.data.title = title;
    interaction.reply({ content: "Der Titel wurde erfolgreich ge\xE4ndert", ephemeral: true });
    await interaction.message.edit({ embeds: [embed] });
  }
};
export {
  ce_title_default as default
};
